import React from 'react';
import { Link } from 'react-router-dom';

import Col1 from "../../components/col1";
import Col2 from "../../components/col2";
import Col3 from "../../components/col3";
import SetCol1 from "../../components/SetCol1";


//Images
import Bedroom from "../../Images/Bedroom/Apartment.jpg"


const Home = ( props ) => {

    props.onSetHour(8);

    if(props.flags.includes("FirstMorning")){
        props.onSpliceFlag("FirstMorning");
        return(
            <>
            <Col1>
                <SetCol1
                money = {props.money}
                energy = {props.energy}
                date = {props.date}
                />
            </Col1>
            <Col2 BackImage = {Bedroom}>
                
            </Col2>
    
            <Col3 > 
                <p>
                    You are home.
                </p>
    
                <Link to={"/Apartment"} style={{ textDecoration: "none" }}>
                    <button type="button" className="btn btn-primary">The next morining</button>
                </Link>
                <Link to={"/Apartment"} style={{ textDecoration: "none" }}>
                    <button type="button" className="btn btn-primary">The next morining</button>
                </Link>
                <Link to={"/Apartment"} style={{ textDecoration: "none" }}>
                    <button type="button" className="btn btn-primary">The next morining</button>
                </Link>
    
            </Col3>
            </>
            )
    
    }


    return(
        <>
        <Col1>
            <SetCol1
            money = {props.money}
            energy = {props.energy}
            date = {props.date}
            />
        </Col1>
        <Col2 BackImage = {Bedroom}>
            
        </Col2>

        <Col3 > 
            <p>
                You are home.
            </p>

            <Link to={"/Apartment"} style={{ textDecoration: "none" }}>
                <button type="button" className="btn btn-primary">The next morining</button>
            </Link>
            <Link to={"/Apartment"} style={{ textDecoration: "none" }}>
                <button type="button" className="btn btn-primary">The next morining</button>
            </Link>
            <Link to={"/Apartment"} style={{ textDecoration: "none" }}>
                <button type="button" className="btn btn-primary">The next morining</button>
            </Link>

        </Col3>
        </>
        )



    }
export default Home;
